import React from "react";
import "./welcome.css";
import $ from "jquery";
$("#parallax").parallax({
  invertX: true,
  invertY: true,
  scalarX: 15,
  frictionY: 0.1,
});



export default function Welcome() {

  return (
    <div>
      <div id="stars"></div>
      <div id="stars2"></div>
      <div id="stars3"></div>

      <div id="parallax">
        <div class="layer" data-depth="0.6">
          <div class="some-space">
            <h1>Welcome</h1>
          </div>
        </div>
        <div class="layer" data-depth="0.4">
          <div id="particles-js"></div>
        </div>

        <div class="layer" data-depth="0.3">
          <div class="some-more-space1">
            <a href="https://codepen.io/figo-kolsteren" target="blank">
              Continue to website
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
